import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';


const routes: Routes = [
  { path: '', redirectTo: '/dashboard', pathMatch: 'full' },
  { path: '**', redirectTo: '/dashboard', pathMatch: 'full' },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }

import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'cypress-diary-app';
}

import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Router } from '@angular/router';

@Injectable({
  providedIn: 'root'
})
export class EntryServiceService {

  constructor(private http: HttpClient, private router: Router) { }

  async getEntries(): Promise<any> {
    return this.http.get('/api/v1/entries/list').toPromise()
      .then(response => {
        return response;
      })
      .catch(err => {
        console.log(err);
      });
  }

  viewEntry(idParam: number): Promise<any> {
    return this.http.get('/api/v1/entries/view-entry/' + idParam).toPromise()
    .then(response => {
      return response;
    })
    .catch(err => {
      console.log(err);
    });
  }

  createEntry(titleParam: string, contentParam: string): Promise<any>  {
    return this.http.post('/api/v1/entries/create-entry', {title: titleParam, content: contentParam}).toPromise()
    .then(response => {
      return response;
    })
    .catch(err => {
      console.log(err);
    });
  }

  updateEntry(idParam: number, titleParam: string, contentParam: string): Promise<any> {
    return this.http.put('/api/v1/entries/update-entry/' + idParam, {title: titleParam, content: contentParam}).toPromise()
    .then(response => {
      return response;
    })
    .catch(err => {
      console.log(err);
    });
  }

  deleteEntry(idParam: number): Promise<any> {
    return this.http.delete('/api/v1/entries/delete-entry/' + idParam).toPromise()
    .then(response => {
      return response;
    })
    .catch(err => {
      console.log(err);
    });
  }
}

import { Component, OnInit } from '@angular/core';
import { EntryServiceService } from '../../services/entry-service.service';
import { ActivatedRoute, Router } from '@angular/router';
import { FormGroup, FormControl } from '@angular/forms';

@Component({
  selector: 'app-create-entry',
  templateUrl: './create-entry.component.html',
  styleUrls: ['./create-entry.component.scss']
})
export class CreateEntryComponent implements OnInit {

  id: number;
  isCreateAction: boolean;

  entryForm = new FormGroup({
    title: new FormControl(''),
    content: new FormControl(''),
  });

  constructor(private entryService: EntryServiceService, private route: ActivatedRoute, private router: Router) { }

  ngOnInit() {
    this.isCreateAction = true;
    const tempId = this.route.snapshot.params.id;
    if (tempId) {
      this.id = this.route.snapshot.params.id;
      this.isCreateAction = false;
      this.getEntry();
    }
  }

  async getEntry() {
    const res = await this.entryService.viewEntry(this.id);
    this.entryForm.controls['title'].setValue(res.statusMessage[0].title);
    this.entryForm.controls['content'].setValue(res.statusMessage[0].content);
  }

  entryAction() {
    this.isCreateAction ? this.createEntry() : this.updateEntry();
    this.router.navigateByUrl('/entries/list');
  }

  cancelAction() {
    const navUrl = this.isCreateAction ? '/entries/list' : `/entries/view-entry/${this.id}`;
    this.router.navigateByUrl(navUrl);
  }

  createEntry() {
    this.entryService.createEntry(this.entryForm.controls['title'].value, this.entryForm.controls['content'].value);
  }

  updateEntry() {
    this.entryService.updateEntry(this.id, this.entryForm.controls['title'].value, this.entryForm.controls['content'].value);
  }

}

import { Component, OnInit } from '@angular/core';
import { Router, NavigationEnd } from '@angular/router';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.scss']
})
export class DashboardComponent implements OnInit {

  constructor(private router: Router) { }

  ngOnInit() {
  }

  navToList() {
    this.router.navigateByUrl('/entries/list');
  }
}

import { Component, OnInit } from '@angular/core';
import { EntryServiceService } from '../../services/entry-service.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-entries-list',
  templateUrl: './entries-list.component.html',
  styleUrls: ['./entries-list.component.scss']
})
export class EntriesListComponent implements OnInit {

  entries: any[];
  links: any[];

  constructor(private entryService: EntryServiceService, private router: Router) { }

  ngOnInit() {
    this.init();
  }

  async init() {
    const res = await this.entryService.getEntries();
    this.entries = res.statusMessage;
    this.links = this.entries.map(e => {
      return { url: '/entries/view-entry', entry: e};
    });
  }

  navToCreate() {
    this.router.navigateByUrl('/entries/create-entry');
  }

  deleteEntry(id: number) {
    this.entryService.deleteEntry(id);
  }

}

import { Component, OnInit } from '@angular/core';
import { EntryServiceService } from '../../services/entry-service.service';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-view-entry',
  templateUrl: './view-entry.component.html',
  styleUrls: ['./view-entry.component.scss']
})
export class ViewEntryComponent implements OnInit {

  id: number;
  title: string;
  content: string;

  constructor(private entryService: EntryServiceService, private route: ActivatedRoute, private router: Router) { }

  ngOnInit() {
    this.id = this.route.snapshot.params.id;
    this.init();
  }

  async init() {
    const res = await this.entryService.viewEntry(this.id);
    this.title = res.statusMessage[0].title;
    this.content = res.statusMessage[0].content;
  }

  navToUpdate() {
    this.router.navigateByUrl('/entries/update-entry/' + this.id);
  }

  navToList() {
    this.router.navigateByUrl('/entries/list');
  }

  async deleteEntry() {
    await this.entryService.deleteEntry(this.id);
    this.router.navigateByUrl('/entries/list');
  }

}

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { DashboardComponent } from './components/dashboard/dashboard.component';
import { ViewEntryComponent } from './components/view-entry/view-entry.component';
import { EntriesListComponent } from './components/entries-list/entries-list.component';
import { CreateEntryComponent } from './components/create-entry/create-entry.component';

const routes: Routes = [
  { path: 'dashboard', component: DashboardComponent },
  { path: 'entries/view-entry/:id', component: ViewEntryComponent },
  { path: 'entries/list', component: EntriesListComponent },
  { path: 'entries/create-entry', component: CreateEntryComponent },
  { path: 'entries/update-entry/:id', component: CreateEntryComponent }
];

@NgModule({
  imports: [ RouterModule.forChild(routes) ],
  exports: [ RouterModule ]
})
export class DiaryEntriesRoutingModule { }

import { CommonModule } from '@angular/common';
import { HttpClientModule } from '@angular/common/http';
import { NgModule } from '@angular/core';
import { ReactiveFormsModule } from '@angular/forms';
import { MatButtonModule } from '@angular/material/button';
import { MatIconModule } from '@angular/material/icon';
import { MatInputModule } from '@angular/material/input';
import { MatListModule } from '@angular/material/list';
import { BrowserModule } from '@angular/platform-browser';

import { CreateEntryComponent } from './components/create-entry/create-entry.component';
import { DashboardComponent } from './components/dashboard/dashboard.component';
import { EntriesListComponent } from './components/entries-list/entries-list.component';
import { ViewEntryComponent } from './components/view-entry/view-entry.component';
import { DiaryEntriesRoutingModule } from './diary-entries-routing.module';
import { EntryServiceService } from './services/entry-service.service';

@NgModule({
  declarations: [
    EntriesListComponent,
    ViewEntryComponent,
    CreateEntryComponent,
    DashboardComponent
  ],
  imports: [
    CommonModule,
    DiaryEntriesRoutingModule,
    BrowserModule,
    MatButtonModule,
    MatListModule,
    MatInputModule,
    ReactiveFormsModule,
    MatIconModule,
    HttpClientModule
  ],
  providers: [
    EntryServiceService
  ]
})
export class DiaryEntriesModule { }

import { BrowserModule } from '@angular/platform-browser';
import { NgModule } from '@angular/core';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { DiaryEntriesModule } from './modules/diary-entries/diary-entries.module';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    DiaryEntriesModule,
    AppRoutingModule,
    BrowserAnimationsModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }

